Often we would like to provide short description of the application, which version it has. We can use the package openapi3 to update OpenApi directly. But also there is a helper type for most often used fields: -- | Default info that is often added to OpenApi schema
data DefaultInfo = DefaultInfo { title :: Text , description :: Text , version :: Text } addDefaultInfo :: DefaultInfo -> OpenApi -> OpenApi We can set title, description and version for the application. Here is an example: setSwagger :: Server IO -> Server IO
setSwagger = withSwagger config where config = (def :: SwaggerConfig IO) { mapSchema = pure . addDefaultInfo info } info = def { title = "Weather forecast" , description = "JSON API example for mig library which shows how to forecast weather to authorized users" , version = "0.1.0" }
